(defn get-rooms [lines]
  (->> lines
       str/split-lines
       (map parse-line)
       #_(filter valid?)))

(defn solve [lines]
  (->> lines
       get-rooms
       (filter valid?)
       (map :sector)
       (map #(Integer/parseInt %))
       (apply +)))

(defn solve2 [lines]
  (->> lines
       get-rooms
       (map #(assoc % :name (decrypted-name %)))
       (filter (comp (partial re-find #"north") :name))))
